  [],\n\t\"revision_timestamp\": \"2016-07-27T22:56:00.008947\",\n\t\"name\": \"browns-park-national-wildlife-refuge-annual-narrative-report-calendar-year-1992\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Browns
  Park NWR outlines Refuge accomplishments during the 1992 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management plans.
  Refuge administration is outlined; information about personnel, funding, and safety
  is given. Habitat management is also covered; subjects include wetlands, forests,
  grasslands, croplands, grazing, fire management, pest control, and wilderness and
  special areas. The wildlife section of the report discusses endangered and threatened
  species, migratory birds, game mammals, fisheries resources, wildlife propagation
  and stocking, and animal control. The public uses of the Refuge described in this
  report include interpretive programs, hunting,  recreational uses, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, major maintenance, equipment replacement, and communication
  systems. Cooperative programs and items of interest are provided at the end. Photographs
  and brochures are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
